CREATE TABLE `city_weathers` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `city_id` int(11) DEFAULT NULL COMMENT '城市ID',
  `weather_html_id` varchar(10) DEFAULT NULL COMMENT '对应的HTML页面的访问ID号',
  `img` varchar(100) DEFAULT NULL COMMENT '天气图片',
  `description` varchar(200) DEFAULT NULL COMMENT '天气描述',
  `wash_car_index` varchar(50) DEFAULT NULL COMMENT '洗车指标',
  `sort_id` int(11) DEFAULT '0' COMMENT '排序ID，0为当天，依次类推',
  `city_name` varchar(20) DEFAULT NULL COMMENT '城市名称',
  `weather` varchar(20) DEFAULT NULL COMMENT '天气情况',
  `low_wen` varchar(30) DEFAULT NULL,
  `wash_car_desc` varchar(1000) DEFAULT NULL COMMENT '洗车描述',
  `high_wen` varchar(30) DEFAULT NULL COMMENT '高温度',
  `wind_power` varchar(20) DEFAULT NULL COMMENT '风力',
  `wind_direction` varchar(20) DEFAULT NULL COMMENT '风向',
  PRIMARY KEY (`id`),
  KEY `city_id_index` (`city_id`),
  KEY `sort_id_key` (`sort_id`)
) ENGINE=InnoDB AUTO_INCREMENT=32634 DEFAULT CHARSET=utf8 COMMENT='城市天气表';
